import React from "react";
import "./Rules.css";

function News() {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Nyheter</h1>
      <div className="rules-container text-break">
        <p>Här hittar du alla nyheter från klubben.</p>
      </div>
    </div>
  );
}

export default News;
